DROP DATABASE IF EXISTS asdoe17;

CREATE DATABASE asdoe17;

USE asdoe17;

CREATE TABLE users (
	user_firstname VARCHAR(256) NOT NULL,
	user_lastname VARCHAR(256) NOT NULL,
	user_email VARCHAR(256) UNIQUE NOT NULL,
	user_username VARCHAR(256) UNIQUE NOT NULL,
	user_password VARCHAR(256) NOT NULL,
	user_zipcode INT(9) NOT NULL,
	user_phonenumber VARCHAR(31) NOT NULL,
	user_id INT(10) UNSIGNED NOT NULL PRIMARY KEY AUTO_INCREMENT,
	city VARCHAR(256) NOT NULL
);

CREATE TABLE post (
	post_id int unsigned NOT NULL PRIMARY KEY AUTO_INCREMENT,
	header varchar(50) NOT NULL,
	description varchar(500) NOT NULL,
	picture mediumBlob NOT NULL,
	time_created TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

